  return (
    <Wrapper>
      <Dialog open={confirmDialog.isOpen}>
        <DialogTitle></DialogTitle>
        <DialogContent className="123">
          <h6>{confirmDialog.message}</h6>
        </DialogContent>
        <DialogActions>
          <Button>Sim</Button>
